import React from "react";

const AddGoal = () => {
  const formStyles = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "1em",
    textAlign: "center",
  };

  const formControlStyles = {
    display: "flex",
    flexDirection: "column",
    gap: "0.25em",
    fontSize: "0.875rem",
  };

  return (
    <form className="goal-add-form" style={formStyles}>
      <div className="form-control" style={formControlStyles}>
        <p>Goal</p>
        <input type="text" placeholder="Add Goal" />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Day</p>
        <input type="text" />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Month</p>
        <input type="text" />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Year</p>
        <input type="text" />
      </div>

      <input type="submit" value="Save Goal" className="btn" />
    </form>
  );
};

export default AddGoal;
